// VARIAVEIS GLOBAIS
var TrocaInstrucao = function(instrucao){
	localStorage.removeItem("novaInstrucao");
	if(instrucao.length < 1){
		localStorage.setItem('novaInstrucao', 'sem instrucao');
	}else{
		localStorage.setItem('novaInstrucao', instrucao);
	}
};
var TrocaNavegacao = function(navegacao){
	localStorage.removeItem("novaNavegacao");
	if(navegacao.length < 1){
		localStorage.setItem('novaNavegacao', 'sem navegacao');
	}else{
		localStorage.setItem('novaNavegacao', navegacao);
	}
};

